import axios from "axios"
import {  useEffect, useState } from "react"
import { Link } from "react-router-dom"
import Swal from "sweetalert2" 

export default function Prodact() {
    const [state, setstate] = useState([])
    function DeleteProdat(props) {
useEffect(() => {
    fetch("https://a-b-dullah.github.io/Dbjson/React.json")
    .then(res=>res.json())
    .then((data) =>
      console.log(data)
    );
})
    Swal.fire({
        title: `Are You sure to Delete ${props} ?`,
        showCancelButton: true
    }).then((data3) => {
        if (data3.isConfirmed) {
  axios.delete(`http://localhost:8000/Prodact/${props}`)
            .then(res => console.log(res))
        
   }})
    }
          
        
axios.get("Js/db.json")
.then(res => setstate(res.data.Prodact), [])
return(
<div style={{backgroundColor:""}}>
<h3>Prodact page</h3>
<Link to="/AddProdact" type="button" className="btn btn-success">Add Prodact</Link>
<table className="table  table-striped mt-3">
<thead>
<tr>
<th>Id</th>
<th>title</th>
<th>price</th>
<th>Options</th>
</tr>
</thead>
<tbody>
    
        {state.map((prodact)=>{
            return(
                <tr key={prodact.id}>
                    <td>{prodact.id}</td>
                    <td>{prodact.title.slice(0,40)}</td>
                    <td>{prodact.price}</td>
                    <td>
<button onClick={()=>DeleteProdat(prodact.id)} type="button" className="btn btn-primary me-1 ">Delete</button>  
<button type="button" className="btn btn-danger me-1">View</button>
<button type="button" className="btn btn-success">Edit</button></td>
                </tr>
            )

        })}
  

</tbody>
</table>
</div>

    )
}
